package com.asiainfo.sh.cache.core.exception;

public class CachePubSubException extends CacheException {

	/**
	 * 
	 */
	private static final long serialVersionUID = 1267568857931473729L;

	public CachePubSubException() {
		super();
	}

	public CachePubSubException(String message, Throwable cause, boolean enableSuppression,
			boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

	public CachePubSubException(String message, Throwable cause) {
		super(message, cause);
	}

	public CachePubSubException(String message) {
		super(message);
	}

	public CachePubSubException(Throwable cause) {
		super(cause);
	}

}
